import React from "react";
import Pion from './Pions';
import NPion from "./NonPion";
import './style.css';

const Case = () => {

    const changeColor = (e) => {
        console.log(e.target)
        if (e.target.classList.contains('clicked')) {
            <NPion />
        } else {
            <Pion />
        }
        e.target.classList.add('clicked')
    }

    return (
        <div className="rondCases" onClick={changeColor}>{ }</div>
    )
}

export default Case;
